import { type } from 'os'
import React from 'react'
 
type SelectPrivacy = {
    label:string,
    option:any[],
    value:any,
}

function Select(props:SelectPrivacy) {
  return (
    <div>
      <label htmlFor="">{props.label}</label>
      <select >
        {
        props.option.map((e,i)=>{
            return <option value={e.value}>{e.gender}</option>
        })
        }
      </select>
    </div>
  )
}

export default Select
